import { Button } from "@mui/material";

const Login = () => {
  return (
    <div className="App">
      <form className="form">
        <input labelText="Email" id="email" type="text" />
        <input labelText="Password" id="password" type="password" />

        <Button type="button" color="primary" className="btn">
          Log in
        </Button>
      </form>
    </div>
  );
};
export default Login;
